// SPDX-License-Identifier: MIT
pragma solidity ^0.8.0;

import "@openzeppelin/contracts/token/ERC20/IERC20.sol";
import "./TokenPool.sol";

contract TokenSwap {
    TokenPool public pool;
    address public owner;
    uint256 public constant RATE = 2; // 1 CEP = 2 LNX
    uint256 public feePercent = 3;

    constructor(address _pool) {
        pool = TokenPool(_pool);
        owner = msg.sender;
    }

    event Swap(address indexed user, string swapType, uint256 inputAmount, uint256 outputAmount, uint256 fee);

    modifier onlyOwner() {
        require(msg.sender == owner, "Not contract owner");
        _;
    }

    function swapCEPForLNX(uint256 _cepAmount) external {
        uint256 lnxAmount = (_cepAmount * RATE);
        uint256 fee = (lnxAmount * feePercent) / 100; 
        uint256 finalLnxAmount = lnxAmount - fee;

        require(pool.cepToken().transferFrom(msg.sender, address(pool), _cepAmount), "CEP transfer failed");

        (uint256 cepReserve, uint256 lnxReserve) = pool.getReserves();
        require(lnxReserve >= finalLnxAmount, "Not enough LNX in pool");

        require(pool.lnxToken().transfer(msg.sender, finalLnxAmount), "LNX transfer failed");
        require(pool.lnxToken().transfer(owner, fee), "Fee transfer failed");

        emit Swap(msg.sender, "CEP to LNX", _cepAmount, finalLnxAmount, fee);
    }

    function swapLNXForCEP(uint256 _lnxAmount) external {
        require(_lnxAmount % RATE == 0, "LNX amount must be a multiple of RATE");
        uint256 cepAmount = _lnxAmount / RATE;
        uint256 fee = (cepAmount * feePercent) / 100;
        uint256 finalCepAmount = cepAmount - fee;

        require(pool.lnxToken().transferFrom(msg.sender, address(pool), _lnxAmount), "LNX transfer failed");

        (uint256 cepReserve, uint256 lnxReserve) = pool.getReserves();
        require(cepReserve >= finalCepAmount, "Not enough CEP in pool");

        require(pool.cepToken().transfer(msg.sender, finalCepAmount), "CEP transfer failed");
        require(pool.cepToken().transfer(owner, fee), "Fee transfer failed");

        emit Swap(msg.sender, "LNX to CEP", _lnxAmount, finalCepAmount, fee);
    }

    function updateFee(uint256 newFee) external onlyOwner {
        require(newFee <= 10, "Fee too high!");
        feePercent = newFee;
    }

    function withdrawFees() external onlyOwner {
        uint256 cepFees = pool.cepToken().balanceOf(address(this));
        uint256 lnxFees = pool.lnxToken().balanceOf(address(this));
        require(pool.cepToken().transfer(owner, cepFees), "Withdraw CEP failed");
        require(pool.lnxToken().transfer(owner, lnxFees), "Withdraw LNX failed");
    }
}

